import {async, ComponentFixture, getTestBed, TestBed} from '@angular/core/testing';
import { RecentTransactionsComponent } from './recent-transactions.component';
import {TransferService} from '../services/transfer.service';
import {of} from 'rxjs';

import {
  MatButtonModule, MatButtonToggleModule,
  MatIconModule,
  MatInputModule,
  MatSortModule,
  MatToolbarModule
} from '@angular/material';
import {ReactiveFormsModule} from '@angular/forms';
import {BrowserAnimationsModule} from '@angular/platform-browser/animations';
import { skip } from 'rxjs/operators';
import {Transaction} from '../services/entities';

describe('RecentTransactionsComponent', () => {
  let injector: TestBed;
  let component: RecentTransactionsComponent;
  let fixture: ComponentFixture<RecentTransactionsComponent>;
  const theTeaLounghTransaction: Transaction = {
    amount: -82.02,
    categoryCode: '#12a580',
    merchant: 'The Tea Lounge',
    // tslint:disable-next-line:max-line-length
    merchantLogo: 'data:image/jpeg;base64,',
    transactionDate: 1476933842000,
    transactionType: 'Card Payment'
  };
  const texacoTransaction: Transaction = {
    amount: -84.64,
    categoryCode: '#d51271',
    merchant: 'Texaco',
    // tslint:disable-next-line:max-line-length
    merchantLogo: 'data:image/jpeg;base64,',
    transactionDate: 1476926642000,
    transactionType: 'Card Payment'
  };

  beforeEach(async(() => {
    TestBed.configureTestingModule({
      imports: [
        ReactiveFormsModule,
        BrowserAnimationsModule,
        MatInputModule,
        MatButtonModule,
        MatIconModule,
        MatSortModule,
        MatToolbarModule,
        MatButtonToggleModule
      ],
      declarations: [ RecentTransactionsComponent ],
      providers: [{
        provide: TransferService,
        useValue: {
          transactions$: of([theTeaLounghTransaction, texacoTransaction])
        }
      }]
    })
    .compileComponents();
    injector = getTestBed();
  }));

  beforeEach(() => {
    fixture = TestBed.createComponent(RecentTransactionsComponent);
    component = fixture.componentInstance;
    component.ngAfterViewInit();
    fixture.detectChanges();
  });

  it('should create', () => {
    expect(component).toBeTruthy();
  });

  it('should sort amount asc', done => {
    component.transactions$.pipe(skip(1)).subscribe( transactions => {
      expect(transactions).toEqual([texacoTransaction, theTeaLounghTransaction]);
      done();
    });
    component.sort.sort({id: 'amount', start: 'asc', disableClear: false});
  });

  it('should sort amount desc', done => {
    component.transactions$.pipe(skip(1)).subscribe( transactions => {
      expect(transactions).toEqual([theTeaLounghTransaction, texacoTransaction]);
      done();
    });
    component.sort.sort({id: 'amount', start: 'desc', disableClear: false});
  });

  it('should sort date asc', done => {
    component.transactions$.pipe(skip(1)).subscribe( transactions => {
      expect(transactions).toEqual([theTeaLounghTransaction, texacoTransaction]);
      done();
    });
    component.sort.sort({id: 'date', start: 'asc', disableClear: false});
  });

  it('should sort date desc', done => {
    component.transactions$.pipe(skip(1)).subscribe( transactions => {
      expect(transactions).toEqual([texacoTransaction, theTeaLounghTransaction]);
      done();
    });
    component.sort.sort({id: 'date', start: 'desc', disableClear: false});
  });

  it('should sort beneficiary asc', done => {
    component.transactions$.pipe(skip(1)).subscribe( transactions => {
      expect(transactions).toEqual([theTeaLounghTransaction, texacoTransaction]);
      done();
    });
    component.sort.sort({id: 'beneficiary', start: 'asc', disableClear: false});
  });

  it('should sort beneficiary desc', done => {
    component.transactions$.pipe(skip(1)).subscribe( transactions => {
      expect(transactions).toEqual([texacoTransaction, theTeaLounghTransaction]);
      done();
    });
    component.sort.sort({id: 'beneficiary', start: 'desc', disableClear: false});
  });

  it('should filter transaction', done => {
    component.transactions$.pipe(skip(1)).subscribe( transactions => {
      expect(transactions).toEqual([texacoTransaction]);
      done();
    });
    component.searchText.setValue('texaco');
  });

});
